            WriteLiteral(@"	  <h3 class=""title"">Manager's Message</h3>
	  <span class=""shape-line""><i class=""icon-19""></i></span>
	  <p>शैक्षिक वर्ष 2018-2019 पायनियर माण्टेसरी स्कूल के लिए परिवर्तन का वर्ष रहा है । छात्रों के सर्वागीण विकास के लिए विभिन्न योजनाएँ शुरू हो गयी है । लखनऊ व बाराबंकी शाखाआँ के मध्य वीडियो कॉन्फ्रेसिंग सिस्टम, जानकीपुरम, सत्यप्रेमी नगर लखपेड़ा बाग़ एल्डिको शाखाओं में आडियो वीडियो कॉन्फ्रेंस रूम तैयार किए गये है जिनमें प्री-नर्सरी से डिग्री तक के छात्र-छात्राओ लिए शैक्षिक सामाजिक कार्यक्रम के साथ वाद-विवाद प्रतियोगिताओं का आयोजन भी लिया जाता है जिससे छात्र-छात्राओ के आत्मविश्वास में वृद्धि हो । स्मार्ट वलास, व अबेकस(Abacus) शुरू किये गये है इसके साथ साथ वैदिक गणित द्वारा भी छात्रों में गणित के प्रति रूचि उत्पन्न की जा रही है ।</p>

	  <p>वर्ष 2018-2019 में प्रदेश स्तरीय बाल विज्ञान काँग्रेस का तीन दिवसीय (प्रायोजन एल्डिको शाखा में किया गया जिसमेँ विद्यालय के छात्रो को इस आयोजन के लिए अनेक जिम्मेदारी दी गई जिसमेँ छात्रो ने प्रबन्धन में भी अपनी प्रतिभा दिखायी । इस दौरान देश के वरिष्ठ वैज्ञानिको से हमारे छा");
            WriteLiteral(@"त्र रूबरू हुए । पायनियर मॉण्टेसरी स्कूल वर्ष 1963 से अपने छात्र-छात्राओ के चहुंमुखी विकास के लिए पूरी तरह के प्रतिबद्ध है । इसलिए समय के साथ आज एवं भविष्य की आवश्यकताओं के अनुरूप बदलाओ को स्वीकार कर छात्रों की शिक्षा एवं दायित्व के लिए तदनुरूप परिवर्तन लिए जाते हैं शैक्षिक सत्र 2019-2020 हमारे लिए और भी महत्वपूर्ण है । इस वर्ष कक्षा 10 एवं कक्षा 12 का प्रथम बैच सी.बीएवंस.ई. की परीक्षा का होगा । पायनियर माण्टेसरी स्कूल with true education अपने छात्रो के उज्जवल भविष्य के लिए हमेशा प्रयास रत रहा है एव आने वाले समय में और बदलाव दिखायी देगे । अभिभावकों के सहयोग के लिए हम उनके आभारी है ।</p>

	  <p>पुनश्च: सभी को उज्जवल भविष्य की शुभकामनाएं ।</p>



	  <div class=""content"">
	   <h4 class=""title"">Er. Brajendra Singh</h4>
");
